import './productlistall.css';

import React from 'react';

import Productlistcard from '../../cards/';

const ProductsListAll = () => {
    return (
        <div>
            <div className='container'>
                <div className='grid-container'>
                    <Productlistcard/>
                </div>

            </div>

        </div>
    )
}
export default ProductsListAll;
